import React from "react";
//import Fab from '@material-ui/core/Fab';
import SearchIcon from '@material-ui/icons/Search';


function SearchBar() {
    return (
        <form className="searchInput">
            <span><SearchIcon /></span>
            <input name="title"
                placeholder="Title" />
        </form>
    )

}


export default SearchBar
